import React, {Component} from 'react';
import {BrowserRouter} from 'react-router-dom';
import Navbar from './layout/Navbar'

class App extends Component {
  render() {
    return (
      <BrowseRouter>
        <div cclassName="App">
          <Navbar />
        </div>
      </BrowseRouter>
    )
  }
}

export default App;
